import { Component } from '@angular/core';
import { TopicServiceService,Topic } from '../services copy/topic-service.service';
import { Router } from '@angular/router';

@Component({
  selector: 'app-add-topic',
  templateUrl: './add-topic.component.html',
  styleUrls: ['./add-topic.component.css']
})
export class AddTopicComponent {
    topic: Topic = {
    topicCode: '',
    topicName: '',
    category: '',
    description: ''
  };

  successMessage: string = '';
  errorMessage: string = '';
    constructor(private topicService: TopicServiceService, private router: Router) {}
    onSubmit() {
    if (!this.topic.topicCode || !this.topic.topicName || !this.topic.category) {
      this.errorMessage = 'Please fill all required fields.';
      return;
    }

    this.topicService.addTopic(this.topic).subscribe({
      next: (res) => {
        this.successMessage = 'Topic added successfully!';
        this.errorMessage = '';
        this.topic = { topicCode: '', topicName: '', category: '', description: '' };
      },
      error: (err) => {
        console.error('Error adding topic:', err);
        this.errorMessage = 'Failed to add topic. Please try again.';
        this.successMessage = '';
      }
    });
  }
}
<div class="add-topic-container">
  <h2>Add New Topic</h2>

  <form class="topic-form" (ngSubmit)="onSubmit()">
    <label>Topic Code *</label>
    <input type="text" [(ngModel)]="topic.topicCode" name="topicCode" placeholder="Enter topic code" required />

    <label>Topic Name *</label>
    <input type="text" [(ngModel)]="topic.topicName" name="topicName" placeholder="Enter topic name" required />

    <label>Category *</label>
    <input type="text" [(ngModel)]="topic.category" name="category" placeholder="Enter category" required />

    <label>Description</label>
    <input type="text" [(ngModel)]="topic.description" name="description" placeholder="Enter description (optional)" />

    <button type="submit">Add Topic</button>
  </form>

  <div class="success" *ngIf="successMessage">{{ successMessage }}</div>
  <div class="error" *ngIf="errorMessage">{{ errorMessage }}</div>
</div>
